Packagist uses the composer config and global ssh-key to get read access to your repositories, so the supervisor worker packagist:run-workers and web-server must run under the user, that have ssh key or composer config that gives it read (clone) access to your git/svn/hg repositories. For example, if your application runs under www-data and have home directory /var/www, directory structure must be like this. └── /var/www/ └── .ssh/ # ssh keys directory ├── config ├── id_rsa # main ssh key ├── private_key_2 # additional ssh key └── private_key_3 └── packeton/ # project dir ├── config APP_COMPOSER_HOME="%kernel.project_dir%/var/.composer" ├── public .... ├── src └── var ├── cache .... └── .composer # APP_COMPOSER_HOME="%kernel.project_dir%/var/.composer" By default, composer configuration load from COMPOSER_HOME and it placed at path %kernel.project_dir%/var/.composer. if you want to setup authentication in auth.json need to place this file to composer home, i e. /var/www/packeton/var/.composer/ See Authentication in auth.json # Example /var/www/packeton/var/.composer/auth.json
{ "http-basic": { "git.example.pl": { "username": "kastus", "password": "489df705a503ac0173256ce01f" } }
} Example ssh config for multiple SSH Keys for different github account/repos, see here for details # ~/.ssh/config - example Host github-oroinc HostName github.com User git IdentityFile /var/www/.ssh/private_key_2 IdentitiesOnly yes Host github-org2 HostName github.com User git IdentityFile /var/www/.ssh/private_key_3 IdentitiesOnly yes Allow connections to http. You can create config.json in the composer home (see APP_COMPOSER_HOME env var) or add this option in the UI credentials form. { "secure-http": false
}
